import { createIcon } from '../createIcon';

export const SquareFullIconConfig = {
  name: 'SquareFullIcon',
  height: 512,
  width: 512,
  svgPath: 'M512 512H0V0h512v512z',
  yOffset: 0,
  xOffset: 0,
};

export const SquareFullIcon = createIcon(SquareFullIconConfig);

export default SquareFullIcon;
